import './Content.scss'
import React from 'react'
import { useState, useEffect } from 'react'
import axios from 'axios'
const Content = () => {
    const [joke,setJoke] = useState('')
    const [err,setErr] = useState('')
    const getNextJoke = async (e) => {
        e.preventDefault()
        const apiUrl = "http://localhost:3001/next"
        try {
            const lastJokeId =  joke ? joke.id : null;
            const response = await axios.get(apiUrl, {lastJokeId})
            if (response) {
                setJoke(response.data.content)
            }
            else {
                console.error('Error fetching next joke')
            }
        } catch (e) {
            console.log(e)
        }
    }
    return (
        <div className = "content">
            {joke && ( 
            <>
                <p className = "story">{joke}</p>
                <hr className='hr' size = "1px"/>
                <div className = "button">
                    <button className = "fun-button" onClick = {getNextJoke}>This is Funny!</button>
                    <button className = "no-button">This is not funny.</button>
                </div>
            </>
            )}
        </div>
    )
}
export default Content
